import React, { createContext } from 'react'

const PageData = createContext()


export default function PageDataContext (props){

  console.log(props)

  let tae = props.page
  return (
    <PageData.Provider value={tae}>
      {props.children}
    </PageData.Provider>
  )
}

// export default PageDataContext
